import React from 'react';

const List = ({listArticles}) => {
  const allArticles = () => {
    listArticles.map(item => {
      <li key={item.id}>
        <h2>{item.title}</h2>
        <time>{item.title}</time>
        <h3>{item.title}</h3>
        <div>{item.conte}</div>
      </li>
    })
  }

  return (
    <ul>{allArticles()}</ul>
  );
};

export default List;
